  const { post, loading } = useSelector((state) => state.post);
  console.log({ posts, loading });

  const configDispatch = useDispatch();
  console.log(configDispatch);

  useEffect(() => {
    configDispatch(postApi());
  }, []);

  return (
    <>
      <div className="">
        <div className="">
          <h1>Hello</h1>
          {post.map((item) => {
            <h2>{item.title}</h2>
          })}
        </div>
      </div>
    </>
  );
};

export default Profile;
